import Vue from 'vue';
import Router from 'vue-router';

var HelloWorld = function HelloWorld() {
  return import("./templates/HelloWorld");
};

var Manage = function Manage() {
  return import("./templates/Manage");
};

var Show = function Show() {
  return import("./templates/Show");
};

Vue.use(Router);
var router = new Router({
  routes: [{
    path: '/',
    name: 'index',
    component: HelloWorld
  }, {
    path: '/manage',
    name: 'Manage',
    component: Manage
  }, {
    path: '/show',
    name: 'Show',
    component: Show
  }]
});
export default router;
